import React from 'react';
import logo from './logo.svg';
import './App.css';
import './main.css';
import { func } from '../../../AppData/Local/Microsoft/TypeScript/3.6/node_modules/@types/prop-types';

const dados = {
  titulo: "Game Fifteen",
}

function GeraBox() {
    for (i = 1; i <= 15; i++) {
    return i;
  }
}

const box = (<div className="box">{GeraBox()}</div>);

function App() {
  return (
    <div className="border">
      <h1>
        {dados.titulo}
      </h1>
      {box}
    </div>
  );
}

export default App;
